import React from 'react';
import './club.jpg';
import './diamond.jpg';
import './heart.jpg';
import './spade.jpg';
import './Card.css'

function Card (props){
    let suitpic = './club.jpg'
      if(props.suit === "club"){
        suitpic = './club.jpg'
      } else if (props.suit === "diamond"){
        suitpic = './diamond.jpg'
      } else if (props.suit === "heart"){
        suitpic = './heart.jpg'
      } else {
        suitpic = './spade.jpg'
      }
    return (
        <span className="ClassicCards">
            <img src = {suitpic} alt="suit" width="40px" height="80px"/>
            {props.number}
        </span>
    );
}

export default Card;
